import React from "react";


function Home() {

    return  (
        <div className="home-div">
           <div id="hero-div">
             <img id="hero-img" src="https://wallpaperhd.wiki/wp-content/uploads/star-wars-wallpaper-4k-epic-star-wars-wallpaper.jpg" alt="hero-image"/>
           </div>
           <h1 id>Home</h1>

        </div>
    )
}
export default Home;
